import './App.css';
import {createStore, applyMiddleware, compose} from 'redux';
import thunk from 'redux-thunk';
import {userReducer} from './redux/Reducers'

import {Provider} from 'react-redux'
import MainFile from './MainFile.js'


let store = createStore(userReducer, compose(applyMiddleware(thunk), window.__REDUX_DEVTOOLS_EXTENSION__()));
function App() {
  return (
    <Provider store = {store}>
      <nav class="navbar navbar-dark bg-dark">
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
      </nav>
      <h1> Hello World!</h1>
      <h3> Below are some users listed, available at "https://jsonplaceholder.typicode.com/users/" </h3>
      <MainFile/>
    </Provider>
  );
}

export default App;
